pub enum Handler<M: Metadata, S: Middleware<M>> {
    Rpc(RpcHandler<M, S>),
    Err(Option<Response>),
    Middleware(Pin<Box<dyn Future<Output =
            hyper::Result<hyper::Response<Body>>> + Send>>),
}

pub enum RequestMiddlewareAction {
    Proceed {
            should_continue_on_invalid_cors: bool,
            request: hyper::Request<Body>,
        },
    Respond {
            should_validate_hosts: bool,
            response: Pin<Box<dyn Future<Output =
            hyper::Result<hyper::Response<Body>>> + Send>>,
        },
}
